import base64

import matplotlib.pyplot as plt
import matplotlib.patches as patches
from PIL import Image
from coresky_daily import Coresky
def verify_slider_target(image_path, target):
    """
    参数：
    - image_path: 图片路径
    - target: 字典，格式为 {'target_x': int, 'target_y': int, 'target': [x, y, w, h]}
    """
    img = Image.open(image_path)
    fig, ax = plt.subplots()
    ax.imshow(img)

    # 解析数据
    x, y = target['target_x'], target['target_y']
    rect_x, rect_y, rect_w, rect_h = target['target']

    # 画红色圆点（滑块目标点）
    ax.plot(x, y, 'ro', markersize=8, label="center (x,y)")

    # 画蓝色矩形框（缺口区域）
    rect = patches.Rectangle((rect_x, rect_y), rect_w, rect_h, linewidth=2, edgecolor='cyan', facecolor='none', label="target area")
    ax.add_patch(rect)

    ax.set_title(f"Target: x={x}, y={y} / Area: {rect_x},{rect_y},{rect_w},{rect_h}")
    ax.legend()
    plt.show()

